webpackJsonp([0xc53fca4bd82d],{9050:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"PHP Magazin",date:"03 Apr 2002",slug:"/2002-04-03-php-magazin/",tags:"Y2002"},html:'<p>I\'ve seen plenty of Linux magazines at gas stations and supermarkets, but when buying groceries this evening I saw <a href="http://www.php-mag.de/">PHP Magazin</a>. I picked it up, so I can now say that everything I know about computing I could have learned at the supermarket. Well, almost everything.</p>'},next:{fields:{title:"Local Bank Robbery Makes CNN",date:"03 Apr 2002",slug:"/2002-04-03-local-bank-robbery-makes-cnn/"}},previous:{fields:{title:"Sand Plumbing",date:"03 Apr 2002",slug:"/2002-04-03-sand-plumbing/"}}},{node:{fields:{title:"Local Bank Robbery Makes CNN",date:"03 Apr 2002",slug:"/2002-04-03-local-bank-robbery-makes-cnn/",tags:"Y2002"},html:'<p>Our local bank robbery has made CNN: <a href="http://www.cnn.com/2002/WORLD/europe/04/03/german.robbery/index.html">Robbers held after 3-nation chase</a>. OK, not all bank robbers crash two borders with hostages trying to reach Kiev. Uelzen is just south of LÃ¼neburg, one county next to ours. The ICE train slows down there slightly on the way to Hannover.</p>'},next:{fields:{title:"Housewarming",date:"03 Apr 2002",slug:"/2002-04-03-housewarming/"}},previous:{fields:{title:"PHP Magazin",date:"03 Apr 2002",slug:"/2002-04-03-php-magazin/"}}},{node:{fields:{title:"Housewarming",date:"03 Apr 2002",slug:"/2002-04-03-housewarming/",tags:"Y2002"},html:'<p>Thanks for <a href="http://hal.editthispage.com/2002/03/31">the</a> <a href="http://www.dangerousmeta.com/posts/02/20020402">housewarming</a> <a href="http://www.vfth.com/2002/04/02">greetings</a>, folks. Nothing like a little bread and salt to make a new place feel like home. Hal also wins the award for first post, er actually <a href="/cgi-bin/mt-comments.cgi?entry_id=1678">first comment</a>. </p>\n<p>The design is still the MT default, all CSS and standards-conformant. I\'m working on implementing the happy stripes from the old design in CSS, if for nothing else to look a little different from all the other MT sites.</p>\n<p>And thanks again to <a href="http://www.userland.com">UserLand</a> for hosting PapaScott on Manila for over 2 years, and best of luck with all the new ventures that seem to be on the horizon.</p>'},next:{fields:{title:"Second Steps",date:"02 Apr 2002",slug:"/2002-04-02-second-steps/"}},previous:{fields:{title:"Local Bank Robbery Makes CNN",date:"03 Apr 2002",slug:"/2002-04-03-local-bank-robbery-makes-cnn/"}}}],pathPrefix:"",first:!1,last:!1,index:909,pageCount:1101}}}});
